(1, 61, 'NENO LA UTANGULIZI', 'welcome-note', '<p>  </p>\r\n<h3 class=\"alert alert-success\" style=\"line-height: 150%; color: darkgreen; font-weight: 500;\"><img style=\"border-radius: 50%;\" src=\"images/leaders/Mwenyekiti.jpg\" width=\"90\" height=\"90\" /><br /><br />Kidumu Chama Cha Mapinduzi, <br /><br />Karibu Umoja wa Vijana wa Chama Cha Mapinduzi Chuo Kikuu cha Dar es Salaam (UVCCM UDSM) nakukaribisha katika kitovu cha fikra Tanzania, UVCCM UDSM, muhimili wa Serikali na Chama cha kuzalisha viongozi mahiri. Hapa ndipo nguli wa siasa za Tanzania wanazaliwa. <br /><br />Kidumu Chama Cha Mapinduzi.</h3>\r\n<p class=\"mb-0 text-right text-success\" style=\"color: darkgreen;\"><em>Joseph Nyakire Murutta, Mwenyekiti wa UVCCM UDSM</em></p>\r\n<p> </p>\r\n<div><br />\r\n<h3 class=\"alert alert-success\" style=\"line-height: 150%; color: darkgreen; font-weight: 500;\"><img style=\"border-radius: 50%;\" src=\"images/leaders/Jaji.jpg\" width=\"90\" height=\"90\" /><br /><br />\"Kuwa Mzalendo sio tu kulipenda Taifa lako bali kuwa tayari kulilinda, kulitetea, kujitoa sadaka kwa manufaa ya Wengi na kizazi kijacho.\" <br /><br />Vijana tuna wajibu wa kuwa wazalendo wa kweli kwa Taifa hili. <br /><br />Kidumu Chama Cha Mapinduzi.</h3>\r\n<p class=\"mb-0 text-right text-success\" style=\"color: darkgreen;\"><em>Julius Jaji, Katibu wa UVCCM UDSM</em></p>\r\n</div>\r\n<p> </p>\r\n<p> </p>', '', 1, 2, '2020-11-14 16:19:15', 906, '', '2020-11-24 22:09:36', 906, 0, '0000-00-00 00:00:00', '2020-11-14 16:19:15', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 108, 10, '', '', 1, 104, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 1, '*', '', ''),
(2, 68, 'KUHUSU UVCCM UDSM', 'about-us', '<p style=\"line-height: 150%;\"> </p>\r\n<p style=\"line-height: 150%;\">UVCCM UDSM ni jumuiya ya wanafunzi, wanachama wa <a title=\"Chama Tawala Tanzania\" href=\"https://ccm.or.tz/home\" target=\"_blank\" rel=\"search noopener noreferrer\">Chama Cha Mapinduzi</a>, wa <a title=\"Chuo cha Kwanza chenye Ubora Tanzania\" href=\"https://udsm.ac.tz\" target=\"_blank\" rel=\"search noopener noreferrer\">Chuo Kikuu cha Dar es Salaam</a>. UVCCM UDSM ni kitovu cha fikra Tanzania na pia ni muhimili wa Serikali na Chama cha kuzalisha viongozi mahiri. Hapa ndipo nguli wa siasa za Tanzania wanazaliwa.</p>', '', 1, 2, '2020-11-15 03:31:02', 906, '', '2020-12-20 18:02:13', 906, 0, '0000-00-00 00:00:00', '2020-11-15 03:31:02', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"0\",\"link_category\":\"0\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"0\",\"show_author\":\"0\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"0\",\"show_item_navigation\":\"\",\"show_icons\":\"0\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"0\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 10, 9, '', '', 1, 33, '{\"robots\":\"\",\"autho