(3, 74, 'MUUNDO WA UONGOZI WA TAWI', 'muundo', '<table style=\"width: 800px; height: 400px; margin-left: 5%;\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 242px;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"images/leaders/Mwenyekiti.jpg\" width=\"150\" height=\"170\" /><br />\r\n<p style=\"text-align: center;\">Joseph Nyakire Murutta</p>\r\n<p style=\"text-align: center;\"><strong>Mwenyekiti wa UVCCM UDSM</strong></p>\r\n</td>\r\n<td style=\"width: 242px;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"images/leaders/Jaji.jpg\" width=\"135\" /><br />\r\n<p style=\"text-align: center;\">Julius Jaji</p>\r\n<p style=\"text-align: center;\"><strong>Katibu wa UVCCM UDSM</strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', '', 1, 2, '2020-11-18 20:58:13', 906, '', '2020-12-20 19:37:01', 906, 0, '0000-00-00 00:00:00', '2020-11-18 20:58:13', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_ar